import React from 'react';
import { Box } from '@chakra-ui/core';
import FinanceStats from '../../components/FinanceStats';

const Dashboard = () => {
    return (
        <Box
            w={0.9}
            m="30px auto"
        >
            <FinanceStats />
        </Box>
    )
}

export default Dashboard;
